function getMB(size) {
	let megas = "";
	let m = size / 1024 / 1024;
	megas = m.toString();
	let ix = megas.indexOf(".");
	if (ix > 0 && megas.length > ix + 2)
		megas = megas.substring(0, ix + 2);

	megas = `${megas}MB`;
	return megas;

}

